import './App.css';
import Account from './app/Account';
import Email from './app/Email';

function App() {
  return (
    <div className="container container-fluid">
      <header className="text-center">
        Getting Started
      </header>
      <Email />
      <Account />
    </div>
  );
}

export default App;
